import JumbotronComp from "../components/JumbotronComp";
import BodyComponent from "../components/BodyComponent";

class HomePage extends Component {
  render() {
    return (
    <div>
      <JumbotronComp />
      <BodyComponent/>
    </div>
    );
  }
}
export default HomePage;
